import React, { Component } from "react";
import { Avatar, Card, Button} from 'antd';
import { UserOutlined ,SearchOutlined} from '@ant-design/icons';
import './App.css';



class FoodPlan extends Component{

   render() {
    return (

      <div class = "Container">
        <div class = "Header">
          header
        </div>
        <div class = "LeftSide">
          <Avatar shape="square" size={100} icon={<UserOutlined />} style={{position: 'absolute',display:'flex',backgroundColor:"white",alignItems:'center',justifyContent:'center'}}/>
          nice

        </div>
        <div class = "Footer">
          Footer
        </div>
        <div class = "Body">
          Body
        </div>
      </div>


    );
  }
}
export default FoodPlan;
